// Public Domain under http://unlicense.org, see link for details.

// A lossless random-access (de)compressor for GLSL (and C).

// See Common tab for (machine-generated) decoder.
// C++ code of the generator is available at https://pastebin.com/GK6fZb13
// or https://gist.github.com/fp64/caf40c13eb74ed159c9e11a8f9686fd3.
// Mouse click for scroll (lower-left corner = auto).

// Algorithm description.
// WARNING: I'm not an expert on compression, and probably am doing
// some pretty stupid things here. Readers are expected to know
// the compression basics (I do not trust myself to explain them well).
//
// The input is split into 16-byte blocks (last one padded with zeroes).
// This fits nicely into uvec4 (GLSL implementations seem happier with
// arrays of vectors for large tables, over arrays of scalars). Bytes
// in uvec4 are in little-endian order.
// User-facing API
//     uvec4 load16(int idx)
// can only read at block granularity and expects idx to be 16-aligned.
// The table of "bookmarks" (for fast random access) stores bit positions
// of start of each block within output (compressed) bitstream. A pair of
// bookmarks fits into uint32: upper 24 bits for offset0, and lower
// 8 bits for offset1-offset0 (in 0..255 range, which assumes 128-bit
// input block cannot be enlarged 2x during compression).
// The encoding alphabet consists of:
//     256 literal symbols
//     variable number of FOLLOW codes
//     variable number of DICT entries
// FOLLOW codes. For each of 256 possible byte values, a table
// of most likely follow-up bytes is stored. The FOLLOW code is simply
// index into this table. FOLLOW code is disallowed at the beginning
// of the block.
// DICT entires. These are simply exact 4-byte sequences, a table of
// which is explicitly stored. Not allowed to span a block boundary.
// NOTE: the absent symbols (i.e. with frequency 0) are excluded
// from encoding, so the effective alphabet may be smaller.
// NOTE: Huffman encoding doesn't require the alphabet to be
// specific size (e.g. power of 2).
// From this alphabet (and corresponding frequencies), the optimal
// length-limited Huffman codes are built. In interest of decoder not
// slowing to a crawl, the decoding tables are stored mostly as-is.
// Essentially we look at MAX_CODELEN bits from the compressed stream
// at current position, which is enough to determine what the initial
// symbol is, and use a look-up table to find out both the symbol
// and its length (i.e. how far we need to advance in the bitstream
// to the next one). Table entries are 16-bit: symbol+(len<<12), and
// are packed 2 per uint32. 
// Compression ratio is rather poor. Here is a comparison with
// some popular codecs (courtesy of lzbench):
//     File: snark72.txt
//     Compressor name   Compr. size  Ratio
//     Uncompressed            63433 100.00
//     *this*                  28720  45.27
//     lz4 1.9.3               21139  33.32
//     lz4hc 1.9.3 -1          18115  28.56
//     lz4hc 1.9.3 -12         17115  26.98
//     zlib 1.2.11 -1          16199  25.54
//     zlib 1.2.11 -9          13859  21.85
//     zstd 1.5.5 -1           14798  23.33
//     zstd 1.5.5 -22          13113  20.67
//     lzma 19.00 -0           14478  22.82
//     lzma 19.00 -9           13047  20.57
// NOTES:
// 1. The input file is https://www.gutenberg.org/ebooks/13 converted
// to Latin-1, padded with spaces to 72x880, with newlines removed.
// 2. Compression options are --codelen=9 --follow=1 --dict=80.
// The --follow is set to 1 for demonstration purposes.
// For this specific file, --follow=0 seems optimal.
// 3. For this compressor, only size of data stored in tables
// is counted. For comparison, the size of the GLSL file
// itself is ~110KB - larger than the original.
// 4. Bookmark tables account for ~8KB.

float print_char(int c,vec2 r)
{
    return textureLod(iChannel0,clamp(r,0.02,0.98)/16.0+fract(vec2(c,15-c/16)/16.0),clamp(log2(0.5*72.0*64.0/iResolution.x),0.0,2.0)).r;
}

void mainImage(out vec4 fragColor,in vec2 fragCoord)
{
    float w=iResolution.x/72.0,h=2.0*w;
    float offset=iTime+5.0;
    if(length(iMouse.xy)>10.0) offset=880.0*(iResolution.y-iMouse.y+1.0)/iResolution.y;
    vec3 col=vec3(0.25);
    vec2 uv=(fragCoord*vec2(1,-1))/vec2(w,h)+vec2(0,offset);
    uv.y=mod(uv.y,960.0);
    ivec2 xy=ivec2(floor(uv));
    int id=xy.x+72*xy.y;
    uvec4 block=load16((id>>4)<<4);
    int c=int(block[(id>>2)&3]>>(8*(id&3))&255u);
    if(c==0) c=32;
    col=mix(col,vec3(0.875),print_char(c,mix(vec2(0.25,1),vec2(0.75,0),fract(uv))));
    fragColor=vec4(col,1.0);
}
